    def run_mapden(self):
        from genovis import mapden
        os.environ["GENOVIS_GUI"] = "1"
        args = argparse.Namespace(
            m=self.lineEdit_m_mapden.text().strip(),
            i=self.lineEdit_i_mapden.text().strip(),
            mode=self.comboBox_mapden_mode.currentText(),
            Chr=self.lineEdit_mapden_chr.text().strip() or "Chr",
            Chrfs=(self.doubleSpinBox_mapden_Chrfs.value()),
            f=self.lineEdit_mapden_f.text().strip() or "Calibri",
            fs=(self.doubleSpinBox_mapden_fs.value()),
            x=(self.doubleSpinBox_mapden_x.value()),
            y=(self.doubleSpinBox_mapden_y.value()),
            c=self.comboBox_mapden_c.currentText(),
            b=(self.doubleSpinBox_mapden_b.value()),
            ft=self.comboBox_mapden_ft.currentText(),
            pad=(self.doubleSpinBox_mapden_pad.value()),
            dpi=(self.spinBox_mapden_dpi.value()),
            o=self.lineEdit_mapden_o.text().strip() or "mapden_plot",)
        buf_out, buf_err = io.StringIO(), io.StringIO()
        try:
            with contextlib.redirect_stdout(buf_out), contextlib.redirect_stderr(buf_err):
                rc = mapden.run(args)
            out = buf_out.getvalue().strip()
            err = buf_err.getvalue().strip()
            msg = (out + ("\n" + err if err else "")).strip() or "SNP density plot generated successfully."
            QtWidgets.QMessageBox.information(None, "Success", msg)
        except RuntimeError as e:
            QtWidgets.QMessageBox.critical(None, "Input Error", str(e))
        except Exception as e:
            QtWidgets.QMessageBox.critical(None, "Unexpected Error", f"{type(e).__name__}: {e}")
